import React, { useState } from "react";
import Input from "./components/Input";
import Context from "./context";

function App() {
  const [goals, setValue] = useState([
    { id: 1, value: "Learn HTML", comleted: false },
    { id: 2, value: "Learn CSS", comleted: false },
    { id: 3, value: "Learn JS", comleted: false },
    { id: 4, value: "Learn React", comleted: false },
  ]);
  console.log(goals);
  function handleValue(value) {
    setValue(value);
  }
  return (
    <div className="wrapper">
      <header className="header">
        <h1 className="header__title">Goals</h1>
      </header>
      <main className="main">
        <div className="goals container">
          <Input onBlur={handleValue} />
        </div>
      </main>
    </div>
  );
}

export default App;
